import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
`;

function Home() {
  return (
    <Wrapper className="row">
      <div className="item"></div>
    </Wrapper>
  );
}

export default Home;
